public class InnerApplicationConfigurationDetailsFactory(Action<Humidifier.ApplicationInsights.ApplicationTypes.ConfigurationDetails> factoryAction = null) : SubResourceFactory<Humidifier.ApplicationInsights.ApplicationTypes.ConfigurationDetails>
{

    internal InnerApplicationNetWeaverPrometheusExporterFactory NetWeaverPrometheusExporterFactory { get; set; }

    internal InnerApplicationSQLServerPrometheusExporterFactory SQLServerPrometheusExporterFactory { get; set; }

    internal InnerApplicationHAClusterPrometheusExporterFactory HAClusterPrometheusExporterFactory { get; set; }

    internal InnerApplicationHANAPrometheusExporterFactory HANAPrometheusExporterFactory { get; set; }

    internal InnerApplicationJMXPrometheusExporterFactory JMXPrometheusExporterFactory { get; set; }

    protected override Humidifier.ApplicationInsights.ApplicationTypes.ConfigurationDetails Create()
    {
        var configurationDetailsResult = CreateConfigurationDetails();
        factoryAction?.Invoke(configurationDetailsResult);

        return configurationDetailsResult;
    }

    private Humidifier.ApplicationInsights.ApplicationTypes.ConfigurationDetails CreateConfigurationDetails()
    {
        var configurationDetailsResult = new Humidifier.ApplicationInsights.ApplicationTypes.ConfigurationDetails();

        return configurationDetailsResult;
    }
    public override void CreateChildren(Humidifier.ApplicationInsights.ApplicationTypes.ConfigurationDetails result)
    {
        base.CreateChildren(result);

        result.NetWeaverPrometheusExporter ??= NetWeaverPrometheusExporterFactory?.Build();
        result.SQLServerPrometheusExporter ??= SQLServerPrometheusExporterFactory?.Build();
        result.HAClusterPrometheusExporter ??= HAClusterPrometheusExporterFactory?.Build();
        result.HANAPrometheusExporter ??= HANAPrometheusExporterFactory?.Build();
        result.JMXPrometheusExporter ??= JMXPrometheusExporterFactory?.Build();
    }

} // End Of Class

